import { useEffect, useState } from "react";

const PRIORITY_STYLES = {
  Critical: "border-red-600 bg-red-50",
  High: "border-orange-500 bg-orange-50",
  Medium: "border-yellow-400 bg-yellow-50",
  Low: "border-green-400 bg-green-50",
};

export default function Dashboard() {
  const [tickets, setTickets] = useState([]);
  const [expandedTicketId, setExpandedTicketId] = useState(null);
  const [visibleCount, setVisibleCount] = useState(10);

  useEffect(() => {
    fetch("http://localhost/tickets-api/tickets_latest.php")
      .then((res) => res.json())
      .then((data) => setTickets(data))
      .catch((err) => console.error("Eroare la fetch:", err));
  }, []);

  const toggleExpand = (id) => {
    setExpandedTicketId(expandedTicketId === id ? null : id);
  };

  const formatDate = (date) => {
    if (!date) return "-";
    if (typeof date === "string") return date.split("T")[0];
    try {
      return new Date(date).toLocaleDateString();
    } catch {
      return "-";
    }
  };

  const visibleTickets = tickets.slice(0, visibleCount);

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="max-w-6xl mx-auto bg-white shadow-xl rounded-2xl p-6">
        <h1 className="text-3xl font-bold mb-6 text-gray-800 text-center">Dashboard - Tickete</h1>

        <div className="space-y-4">
          {visibleTickets.map((ticket) => (
            <div
              key={ticket.id}
              className={`rounded-lg border-l-8 p-4 shadow-sm transition-all ${
                PRIORITY_STYLES[ticket.priority_name] || "border-gray-300 bg-white"
              }`}
            >
              <div className="flex justify-between items-center">
                <div className="space-y-1">
                  <p className="font-semibold text-lg text-gray-900">{ticket.incident_title}</p>
                  <div className="text-gray-600 text-sm flex flex-wrap gap-4">
                    <span><strong>Status:</strong> {ticket.status}</span>
                    <span><strong>Prioritate:</strong> {ticket.priority_name}</span>
                    <span><strong>Creat de:</strong> {ticket.created_by}</span>
                    <span><strong>Start:</strong> {formatDate(ticket.start_date)}</span>
                  </div>
                </div>

                <button
                  onClick={() => toggleExpand(ticket.id)}
                  className="w-8 h-8 bg-blue-500 text-white font-bold rounded-full hover:bg-blue-600"
                >
                  {expandedTicketId === ticket.id ? "-" : "+"}
                </button>
              </div>

              {expandedTicketId === ticket.id && (
                <div className="mt-4 border-t pt-4 text-sm text-gray-700 space-y-1">
                  <p><strong>Assigned Person:</strong> {ticket.assigned_person || "-"}</p>
                  <p><strong>Team:</strong> {ticket.team_assigned_person || "-"}</p>
                  <p><strong>Project:</strong> {ticket.project || "-"}</p>
                  <p><strong>Comentariu:</strong> {ticket.comment || "-"}</p>
                  <p><strong>Rezolvare:</strong> {ticket.resolution || "-"}</p>
                  <p><strong>Inchidere:</strong> {formatDate(ticket.closed_date)}</p>
                </div>
              )}
            </div>
          ))}
        </div>

        {visibleCount < tickets.length && (
          <div className="text-center mt-6">
            <button
              className="px-4 py-2 bg-blue-500 text-white rounded hover:bg-blue-600"
              onClick={() => setVisibleCount((prev) => prev + 10)}
            >
              Încarcă mai multe
            </button>
          </div>
        )}
      </div>
    </div>
  );
}
